    false,nt"url": null,nt"notes": ""The American Woodcock was studied from
    23 May until 26 August 1983 by a summer crew of interns at the Moosehorn National
    Wildlife Refuge in Washington County, Maine. Radio telemetry of the birds was the
    focus of the study, with both diurnal and nocturnal locating performed daily. Four
    methods of capturing woodcock were used: bird dog, night-lighting, mist-netting,
    and ground traps.  A total of 82 woodcock were banded this summer, 35 of which were
    radio tagged.  Vegetation plots done on areas used by radio-tagged birds provided
    information on woodcock habitat use."",nt"license_title": "License Not Specified",nt"extras":
